import React from "react";
import "./Glowna.css";
import Slider from "../Slider/Slider";
import Para from "../UI/Para";
import FrameUp from "../UI/FrameUp";
import Text from "../UI/Text";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBuilding } from "@fortawesome/free-solid-svg-icons";

export default function Glowna() {
  return (
    <div>
      <div className="main">
        <div>
          <Slider />
          <Para>
            <FrameUp>
              <FontAwesomeIcon
                icon={faBuilding}
                color="white"
                font-size="30px"
              />
              <h2>Biuro rachunkowe BALANS</h2>
            </FrameUp>
            <Text>Biuro rachunkowe BALANS powstało z myślą o ludziach, którzy
            potrzebują pomocy i wsparcia w gąszczu wielu niezrozumiałych
            przepisów. Nasze biuro powstało, by wesprzeć w opracowaniu
            dokumentacji kadrowej, płacowej i wielu innych obowiązkach, jakie
            ciążą na pracodawcach i ich przedsiębiorstwach.</Text>
          </Para>
          <Para>
            Nasze usługi pozwolą zaoszczędzić cenny czas, natomiast Państwo
            będziecie spokojni o zrealizowanie wielu biurokratycznych spraw co
            pozwoli na dalszy rozwój przedsiębiorstwa.
          </Para>
          <Para>
            Nasze biuro rachunkowe jest dla każdego, nawet dla osoby, która nie
            prowadzi firmy – Ty także jesteś dla Nas ważny! Świadczymy usługi
            elektronicznej wysyłki wniosków o świadczenia wychowawcze 500+,
            wniosków 300+ czy sporządzamy za Państwa wnioski emerytalno-rentowe.
          </Para>
        </div>
      </div>
    </div>
  );
}
